import React from 'react';
import Header from './Header';
import { useSelector } from 'react-redux';

function Last() {

    const {les} = useSelector(state => state.userReducer)

    return (
        <div>
            <Header/>
            <div className='wrapper my-5'>
                <video controls width={900} height={450} src={"http://localhost:8080/file/" + les?.video}></video>
            </div>
        </div>
    );
}

export default Last;
